class List extends Component {

    render() {
		const {button} = this.props
        return (
        	<Fragment>
	           	<li data-done = {this.props.done} >{this.props.task}</li>
	           	<button onClick = {button} >X</button>
	        </Fragment>
        );
    }
}

export default List;
